import React from "react";
import { BrowserRouter as Router,BrowserRouter, Redirect,Switch,Route } from "react-router-dom";
import "./App.css";
import Navbar from "./components/navbar/navbar";
import Home from "./pages/home/home";
import About from "./pages/about/about";
import Experience from "./pages/experience/experience";
import Projects from "./pages/projects/projects";
import Mailer from "./pages/contact/contact";
import AboutUpdate from "./components/about.crud";
import Login from "./components/login/login";



const LoginContainer = () => (
  <div className="container">
    <Route exact path="/" render={() => <Redirect to="/login" />} />
    <Route path="/login" component={Login} />
  </div>
)



const DefaultContainer = () => (
  <div>
  <Header toggleAlert={this.toggleAlert} />
  <div className="container">
    <Navbar />
    <Route path="/main" component={Main} />
    <Route path="/user" component={User} />
    <Route path="/hw-setting" component={Setting} />
    <Route path="/hw-detail/:id" component={HwDetail} />
    <Route path="/gas-detail/:id" component={GasDetail} />
    {this.state.isAlertOpen ? <Alert /> : null}
  </div>
  </div>
)

function App() {
  return (
    <BrowserRouter>
  <Switch>
  <div className="App">
    <Route exact path="/(login)" component={LoginContainer}/>
    <Route component={DefaultContainer}/>

  </div>
  </Switch>
</BrowserRouter>





